import React from 'react';
import styles from './NavigationItem.module.css';
import { NavLink } from 'react-router-dom';

const navigationItem = ({ className, children, exact }) => {
  return (
    <li className={className}>
      <NavLink

        exact={props.exact}
        to={props.link}
      >
        {props.children}
      </NavLink>
    </li>
  );
}


export default navigationItem;
